class Solution {
public:
	int numSubarrayProductLessThanK(vector<int>& nums, int k){
		//Runtime: 236 ms (98%)
		//Memory Usage: 92.3 MB (0% при минимуме в 91.8 MB)
		
		
		if (nums.empty()) return 0;
		
		int answer = 0;
		int left = -1, right = -1, product = 0;
		
		while (true){
			if (product == 0){
				left = findLeft(nums, k, left);
				//cout<<"l="<<left<<endl;
				if (left == -1) return answer;
				right = findRight(nums, k, left, product);
				answer += subarrayCount(right-left+1);
				//cout<<answer<<" l="<<left<<" r="<<right<<endl;
				if (right == nums.size()-1) return answer;
			} else {
				right++;
				if (nums[right]<k){
					product *= nums[right];
					left = findLeftFromRight(nums, k, left, product);
					//cout<<answer<<" l="<<left<<" r="<<right<<endl;
					
					answer -= subarrayCount(right-left);
					//Есть возможность расширить направо!
					right = expandRight(nums, k, right, product);////////////////////////
					answer += subarrayCount(right-left+1);
					//cout<<answer<<" l="<<left<<" r="<<right<<endl;
					if (right == nums.size()-1) return answer;
					
					
				} else {
					left = findLeft(nums, k, right);
					//cout<<"l="<<left<<endl;
					if (left == -1) return answer;
					right = findRight(nums, k, left, product);
					answer += subarrayCount(right-left+1);
					//cout<<answer<<" l="<<left<<" r="<<right<<endl;
					if (right == nums.size()-1) return answer;
				}
			}
			
		}
		return answer;
	}
	/*int numSubarrayProductLessThanK(vector<int>& nums, int k){
		int answer = 0;
		int cur_product;
		for (int i=0; i<nums.size(); i++){
			if (nums[i]<k) {
				answer++;
				cur_product = nums[i];
				for (int j=i+1; j<nums.size(); j++){
					cur_product *= nums[j];
					if (cur_product < k){
						answer++;
					} else {
						break;
					}
				}
			}
		}
		return answer;
	}*/
private:
	int findLeft(vector<int>& nums, int k, int prevLeft){
		//cout<<"FL"<<endl;
		for (int i=prevLeft+1; i<nums.size(); i++){
			if (nums[i]<k)
				return i;
		}
		return -1;
	}
	int findRight(vector<int>& nums, int k, int left, int & product){
		//cout<<"FR"<<endl;
		product = nums[left];
		for (int i = left+1; i<nums.size(); i++){
			product *= nums[i];
			if (product >= k){
				product /= nums[i];
				return i-1;
			}
		}
		return nums.size()-1;
	}
	int findLeftFromRight(vector<int>& nums, int k, int left, int & product){
		//cout<<"FLFR"<<endl;
		//Уменьшаем, сужаем подмассив по левой стороне до тех пор, пока произведение не будет меньше k
		while (product >= k){
			product /= nums[left];
			left++;
		}
		return left;
	}
	int expandRight(vector<int>& nums, int k, int right, int & product){
		//cout<<"ER"<<endl;
		for (int i = right+1; i<nums.size(); i++){
			product *= nums[i];
			if (product >= k){
				product /= nums[i];
				return i-1;
			}
		}
		return nums.size()-1;
	}
	int subarrayCount(int arraySize){
		int answer = 0;
		for (int i=0; i<arraySize; i++){
			answer += i + 1;
		}
		return answer;
	}
};

